import React from "react";
import { Avatar, Button } from "antd";

import avatar4 from "../assets/images/users/avatar-4.jpg";

export const ContactsToSelect = () => {
return( 
    <div
        className="ct-chat-user-item " >
        <div className="ct-chat-user-row">
          <div className="ct-chat-avatar">
            <img alt="chat-avatar" src={avatar4}/>
          </div>

          <div className="ct-chat-contact-col">
            <div className="ct-chat-user-name">Daniel Chaves</div>
            <div className="ct-chat-user-des ct-text-truncate">daniel.cassiano@live.com</div>
          </div>
          </div>
        </div>
    );
}
